import propTypes from "prop-types";
import useState from "react";
count = 0;
function App({ name: user_name, age: user_age }) {
  return (
    <div>
      <h1>Count is {count}</h1>
      <button onClick={countUp}>click</button>
    </div>
  );
}
const [count, setCount] = useState();

function countUp() {
  setCount(count++);
}
// App().propTypes = { name: propTypes.string };
// App.defaultProps = { name: "Defualt" };
